// chapter10_08-000_pi_spigot_single.cpp

// This program can be used to compute many thousands
// of decimal digits of digits of pi. Although it uses
// a so-called spigot algorithm having quadratic complexity,
// this program can, albeit slowly, compute up to a few million
// decimal digits of pi on a PC host.

#include <algorithm>
#include <cstdint>
#include <ctime>
#include <iomanip>
#include <iostream>
#include <iterator>
#include <numeric>
#include <string>
#include <vector>

namespace math { namespace constants {

template<const std::uint32_t ResultDigit,
         const std::uint32_t LoopDigit>
class pi_spigot_base
{
protected:
  // Support up to one million one thousand and one decimal digits.

  // Table of calculation characteristics
  //   digits(*)   operation count   time[s]   memory[byte]
  //  -----------------------------------------------------
  // 1,000,001(9)  191,360,030,868   2,100      13,777,788
  //   500,001(9)   47,840,521,610     520       6,888,900
  //   250,001(9)   11,960,387,349     130       3,444,456
  //   100,001(9)    1,913,780,868      21       1,377,788
  //    50,001(9)      478,496,610       5.3       688,900
  //    25,001(9)      119,649,849       1.4       344,456
  //    10,001(9)       19,155,868       0.23      137,788
  //     5,001(9)        4,794,110       0.055      68,900
  //     1,001(9)          193,368       0.002      13,788

  //    50,001(8)      527,446,878
  //    25,001(8)      131,887,503
  //    10,001(8)       21,114,378

  //    54,932(4)    1,320,263,154
  //    50,001(4)    1,093,875,003
  //    25,001(4)      273,500,003
  //    10,001(4)       43,775,003
  //     5,001(4)       10,950,003
  //     2,001(4)        1,755,003
  //     1,001(4)          440,003
  //       501(4)          110,628
  //       201(4)           18,003
  //       101(4)            4,628
  //        51(4)            1,222
  //        21(4)              228
  //        11(4)               72

  // (*) Here, the number in parentheses such as
  // (9), (8) or (4) means calculating groups
  // of 9, 8 or 4 digits per loop, corresponding
  // to the template parameter loop_digit.

  static constexpr std::uint32_t result_digit = ResultDigit;
  static constexpr std::uint32_t loop_digit   = LoopDigit;

  static_assert(result_digit <= UINT32_C(1001001),
                "Error: result_digit exceeds its limit of 1,001,001");

  static_assert((loop_digit >= UINT32_C(4)) && (loop_digit <= UINT32_C(9)),
                "Error: loop_digit is outside its range of 4...9");

  static constexpr std::uint32_t input_scale(std::uint32_t x)
  {
    return std::uint32_t(x * std::uint32_t((std::uint32_t(UINT32_C(10) * loop_digit) / UINT32_C(3)) + UINT32_C(1))) / loop_digit;
  }

  static constexpr std::uint32_t pow10(std::uint32_t n)
  {
    return ((n == UINT32_C(0)) ? UINT32_C(1) : pow10(n - UINT32_C(1)) * UINT32_C(10));
  }

  static constexpr std::uint32_t d_init = pow10(loop_digit) / UINT32_C(5);

public:
  using output_value_type = std::uint8_t;

  pi_spigot_base(const pi_spigot_base&) = delete;

  virtual ~pi_spigot_base() = default;

  pi_spigot_base& operator=(const pi_spigot_base&) = delete;

  static constexpr std::uint32_t get_output_static_size()
  {
    return result_digit;
  }

  static constexpr std::uint32_t get_input_static_size()
  {
    return input_scale(get_output_static_size());
  }

  std::uintmax_t get_operation_count() const
  {
    return my_operation_count;
  }

  std::uint32_t get_output_digit_count() const
  {
    return (std::min)(my_j, get_output_static_size());
  }

protected:
  std::uint32_t  my_c;
  std::uint64_t  my_d;
  std::uint32_t  my_j;
  std::uintmax_t my_operation_count;
  std::uint32_t  my_output_count;

  pi_spigot_base() : my_c              (0U),
                     my_d              (0U),
                     my_j              (0U),
                     my_operation_count(0U),
                     my_output_count   (0U) { }

  template<typename OutIn>
  void do_extract_digit_group(OutIn output_first)
  {
    // Parse the next digits of pi, where the group has loop_digit digits.
    // If loop_digit is 4, for instance, then successive groups
    // of digits have a form such as: 3141, 5926, ..., etc.

    const std::uint32_t next_digits =
      my_c + std::uint32_t(my_d / pow10(loop_digit));

    my_c = std::uint32_t(my_d % pow10(loop_digit));

    const std::uint32_t n =
      (std::min)(loop_digit,
                  std::uint32_t(result_digit - my_j));

    std::uint32_t scale10 = pow10(loop_digit - UINT32_C(1));

    for(std::size_t i = std::size_t(0U); i < std::size_t(n); ++i)
    {
      output_first[my_j + i] =
        output_value_type(std::uint32_t(next_digits / scale10) % UINT32_C(10));

      scale10 /= UINT32_C(10);
    }

    my_output_count += n;
  }
};

// The pi spigot program, as single-shot calculation.
template<const std::uint32_t ResultDigit,
          const std::uint32_t LoopDigit>
class pi_spigot_single : public pi_spigot_base<ResultDigit,
                                               LoopDigit>
{
private:
  using base_class_type = pi_spigot_base<ResultDigit,
                                          LoopDigit>;

public:
  pi_spigot_single() = default;

  virtual ~pi_spigot_single() = default;

  template<typename ItIn,
            typename ItOut>
  void calculate(ItIn  input_first,
                  ItOut output_first)
  {
    // Use pi_spigot::calculate() to calculate
    // result_digit decimal digits of pi.

    // The caller is responsible for providing both
    // input memory for the internal calculation details
    // as well as output memory for the result of pi.

    base_class_type::my_c = UINT32_C(0);

    base_class_type::my_output_count = UINT32_C(0);

    base_class_type::my_operation_count = UINTMAX_C(0);

    // Operation count Mathematica(R), example for loop_digit=9.
    // Sum[Floor[((d - j) (Floor[((10 9)/3)] + 1))/9], {j, 0, Floor[d/9] 9, 9}]
    for(base_class_type::my_j = UINT32_C(0); base_class_type::my_j < base_class_type::result_digit; base_class_type::my_j += base_class_type::loop_digit)
    {
      base_class_type::my_d = UINT64_C(0);

      auto i = std::int32_t(base_class_type::input_scale(base_class_type::result_digit - base_class_type::my_j) - INT32_C(1));

      for( ; i >= INT32_C(0); --i)
      {
        const std::uint32_t di =
          ((base_class_type::my_j == UINT32_C(0)) ? base_class_type::d_init : input_first[std::uint32_t(i)]);

        base_class_type::my_d +=
          std::uint64_t(std::uint64_t(di) * base_class_type::pow10(base_class_type::loop_digit));

        const std::uint32_t b =
          std::uint32_t(std::uint32_t(i) * UINT32_C(2)) + UINT32_C(1);

        input_first[std::uint32_t(i)] = std::uint32_t(base_class_type::my_d % b);

        base_class_type::my_d /= b;

        if(i > INT32_C(1))
        {
          base_class_type::my_d *= std::uint32_t(i);
        }

        ++base_class_type::my_operation_count;
      }

      base_class_type::do_extract_digit_group(output_first);
    }
  }
};

} } // namespace math::constants

template<const std::uint32_t result_digit,
         const std::uint32_t loop_digit>
bool test_pi_spigot_single()
{
  using pi_spigot_type =
    math::constants::pi_spigot_single<result_digit,
                                      loop_digit>;

  using input_container_type  = std::vector<std::uint32_t>;
  using output_container_type = std::vector<std::uint8_t>;

  input_container_type  pi_in (pi_spigot_type::get_input_static_size());
  output_container_type pi_out(pi_spigot_type::get_output_static_size());

  const std::clock_t start = std::clock();

  pi_spigot_type ps;
  ps.calculate(pi_in.begin(), pi_out.begin());

  const std::clock_t stop = std::clock();

  const float elapsed = float(stop - start) / float(CLOCKS_PER_SEC);

  {
    extern const std::string& test_data_control();

    const bool result_test_pi_spigot_single_is_ok =
      std::equal(pi_out.cbegin(),
                 pi_out.cend(),
                 test_data_control().cbegin(),
                 [](const std::uint8_t& by, const char& c) -> bool
                 {
                   return (by == std::uint8_t(std::uint8_t(c) - UINT8_C(0x30)));
                 });

    std::cout << "result_digit: "
              << result_digit
              << std::endl
              << "result_test_pi_spigot_single_is_ok: "
              << std::boolalpha
              << result_test_pi_spigot_single_is_ok
              << std::endl
              << "elapsed time: "
              << std::setprecision(3)
              << std::fixed
              << elapsed
              << "s"
              << std::endl
              << "operation_count: "
              << ps.get_operation_count()
              << std::endl
              << "input memory consumption: "
              << pi_in.size() * sizeof(input_container_type::value_type)
              << std::endl
              << std::endl;

    return result_test_pi_spigot_single_is_ok;
  }
}

int main()
{
  const bool result_is_ok = test_pi_spigot_single<10001U, 9U>();

  std::cout << "result_is_ok: " << std::boolalpha << result_is_ok << std::endl;

  return (result_is_ok ? 0 : -1);
}

